INSERT INTO `customers` VALUES ('30', 'บล็อคพ่นสี', 'yai', ' 0851003160', '1', 'yai', 'ร้านทำทุกอย่างดอทคอม  \r\nK เข้ม 0851003160\r\n\r\nเลขตึก  162/532  บางแคคอนโดทาวน  \r\nห้อง 168 อาคารพาณิชย์  ก่อนถึงศาลพระภูมิ  \r\nถ.เพชรเกษม   แขวงบางแคเหนือ เขตบางแค  กรุงเทพน  10160', null, '<p>บล็อคพ่นสี ขนาด A4 1 ชิ้นๆละ 320.- รวมส่ง</p><p>*ข้อมูลอยู่ในเมล์</p>8 พ.ค. 2021 9.08 น.<span class=\"text-dark ml-2\">', null, '2021-05-10', '10:00:00', '3, 4', null, '2021-05-08 09:08:49', '8', 'rJAJa1zr9t8YihRUh5yKM6', '1', '0', '0', '0', '0', '1', '0', null, null, '0', '0', '0', '0', '0', null, null, null);
