INSERT INTO `customers` VALUES ('32', 'ภาพพิมพ์ยูวี', 'พี่บัญชา นายกโบ๊ท', '-', '4', '-', '* รับงานหน้าร้าน ', null, '<p>ภาพพิมพ์ยูวี 40x60 ซม.<br>*เปลี่ยนพื้นหลังเป็นสีน้ำเงิน<br><br>*งานฟรีพี่เฟิร์นไม่คิดเงิน</p>', null, '2021-05-10', '10:10:00', '3, 4', null, '2021-05-08 10:11:42', '8', 'm0KhYK9RmwgVOGo-0MmlhG', '0', '0', '0', '0', '0', '1', '0', null, null, '0', '0', '0', '0', '0', null, null, null);
